import styled  from "styled-components"

export const List = styled.ul`
list-style:none;
 display:flex;
 max-width:100%;
 height:3.5rem;
 background-color:red;
 justify-content:center;
 align-items:center;
     color: var(--blackText);
    font-size: 14px;
    font-weight: 00;
    text-decoration: none;
    text-transform: capitalize;
}
`
